INSERT INTO `sys_oper_log` VALUES (1,'创建表',0,'com.ruoyi.generator.controller.GenController.createTableSave()','POST',1,'admin','研发部门','/tool/gen/createTable','172.20.0.1','内网IP','{\"sql\":\"-- 学生信息表\\nCREATE TABLE `student_info` (\\n  `student_id` VARCHAR(20) PRIMARY KEY COMMENT \'学号\',\\n  `name` VARCHAR(50) NOT NULL COMMENT \'姓名\',\\n  `gender` CHAR(1) NOT NULL COMMENT \'性别\',\\n  `age` INT NOT NULL COMMENT \'年龄\',\\n  `college` VARCHAR(100) NOT NULL COMMENT \'学院\',\\n  `major` VARCHAR(100) NOT NULL COMMENT \'专业\',\\n  `grade` VARCHAR(20) NOT NULL COMMENT \'年级\',\\n  `contact` VARCHAR(20) NOT NULL COMMENT \'联系方式\',\\n  `family_address` VARCHAR(255) NOT NULL COMMENT \'家庭住址\',\\n  `family_income` DECIMAL(10,2) NOT NULL COMMENT \'家庭年收入\',\\n  `create_time` DATETIME DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\\n  `update_time` DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\'\\n);\\n\\n-- 贫困申请表\\nCREATE TABLE `poverty_application` (\\n  `application_id` INT AUTO_INCREMENT PRIMARY KEY COMMENT \'申请ID\',\\n  `student_id` VARCHAR(20) NOT NULL COMMENT \'学号\',\\n  `application_date` DATE NOT NULL COMMENT \'申请日期\',\\n  `poverty_reason` TEXT NOT NULL COMMENT \'贫困原因\',\\n  `supporting_documents` TEXT COMMENT \'证明材料\',\\n  `status` ENUM(\'待审核\', \'已通过\', \'已拒绝\') NOT NULL DEFAULT \'待审核\' COMMENT \'审核状态\',\\n  `reviewer_id` VARCHAR(20) COMMENT \'审核人ID\',\\n  `review_date` DATE COMMENT \'审核日期\',\\n  `review_comments` TEXT COMMENT \'审核意见\',\\n  FOREIGN KEY (student_id) REFERENCES student_info(student_id)\\n);\\n\\n-- 资助信息表\\nCREATE TABLE `financial_aid` (\\n  `aid_id` INT AUTO_INCREMENT PRIMARY KEY COMMENT \'资助ID\',\\n  `student_id` VARCHAR(20) NOT NULL COMMENT \'学号\',\\n  `aid_type` VARCHAR(50) NOT NULL COMMENT \'资助类型\',\\n  `aid_amount` DECIMAL(10,2) NOT NULL COMMENT \'资助金额\',\\n  `grant_date` DATE NOT NULL COMMENT \'发放日期\',\\n  `grant_status` ENUM(\'待发放\', \'已发放\', \'已取消\') NOT NULL DEFAULT \'待发放\' COMMENT \'发放状态\',\\n  FOREIGN KEY (student_id) REFERENCES student_info(student_id)\\n);\\n\\n-- 通知公告表\\nCREATE TABLE `announcement` (\\n  `announcement_id` INT AUTO_INCREMENT PRIMARY KEY COMMENT \'通知ID\',\\n  `title` VARCHAR(100) NOT NULL COMMENT \'标题\',\\n  `content` TEXT NOT NULL COMMENT \'内容\',\\n  `publish_date` DATETIME NOT NULL COMMENT \'发布日期\',\\n ','{\"msg\":\"创建表结构异常\",\"code\":500}',0,NULL,'2024-09-28 14:05:53',55),(2,'创建表',0,'com.ruoyi.generator.controller.GenController.createTableSave()','POST',1,'admin','研发部门','/tool/gen/createTable','172.20.0.1','内网IP','{\"sql\":\"-- 学生信息表\\nCREATE TABLE `student_info` (\\n  `student_id` VARCHAR(20) PRIMARY KEY COMMENT \'学号\',\\n  `name` VARCHAR(50) NOT NULL COMMENT \'姓名\',\\n  `gender` CHAR(1) NOT NULL COMMENT \'性别\',\\n  `age` INT NOT NULL COMMENT \'年龄\',\\n  `college` VARCHAR(100) NOT NULL COMMENT \'学院\',\\n  `major` VARCHAR(100) NOT NULL COMMENT \'专业\',\\n  `grade` VARCHAR(20) NOT NULL COMMENT \'年级\',\\n  `contact` VARCHAR(20) NOT NULL COMMENT \'联系方式\',\\n  `family_address` VARCHAR(255) NOT NULL COMMENT \'家庭住址\',\\n  `family_income` DECIMAL(10,2) NOT NULL COMMENT \'家庭年收入\',\\n  `create_time` DATETIME DEFAULT CURRENT_TIMESTAMP COMMENT \'创建时间\',\\n  `update_time` DATETIME DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT \'更新时间\'\\n);\\n\\n-- 贫困申请表\\nCREATE TABLE `poverty_application` (\\n  `application_id` INT AUTO_INCREMENT PRIMARY KEY COMMENT \'申请ID\',\\n  `student_id` VARCHAR(20) NOT NULL COMMENT \'学号\',\\n  `application_date` DATE NOT NULL COMMENT \'申请日期\',\\n  `poverty_reason` TEXT NOT NULL COMMENT \'贫困原因\',\\n  `supporting_documents` TEXT COMMENT \'证明材料\',\\n  `status` ENUM(\'待审核\', \'已通过\', \'已拒绝\') NOT NULL DEFAULT \'待审核\' COMMENT \'审核状态\',\\n  `reviewer_id` VARCHAR(20) COMMENT \'审核人ID\',\\n  `review_date` DATE COMMENT \'审核日期\',\\n  `review_comments` TEXT COMMENT \'审核意见\',\\n  FOREIGN KEY (student_id) REFERENCES student_info(student_id)\\n);\\n\\n-- 资助信息表\\nCREATE TABLE `financial_aid` (\\n  `aid_id` INT AUTO_INCREMENT PRIMARY KEY COMMENT \'资助ID